class Sing_up_to_dart {  Token? token;  Account? account;  Sing_up_to_dart({this.token, this.account});  Sing_up_to_dart.fromJson(Map<String, dynamic> json) {    token = json['token'] != null ? new Token.fromJson(json['token']) : null;    account =    json['account'] != null ? new Account.fromJson(json['account']) : null;  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    if (this.token != null) {      data['token'] = this.token!.toJson();    }    if (this.account != null) {      data['account'] = this.account!.toJson();    }    return data;  }}class Token {  String? access;  Token({this.access});  Token.fromJson(Map<String, dynamic> json) {    access = json['access'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['access'] = this.access;    return data;  }}class Account {  int? id;  String? name;  String? email;  Null? profilePic;  Account(      {this.id, this.name, this.email, this.profilePic});  Account.fromJson(Map<String, dynamic> json) {    id = json['id'];    name = json['first_name'];    email = json['email'];    profilePic = json['profile_pic'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['id'] = this.id;    data['name'] = this.name;    data['email'] = this.email;    data['profile_pic'] = this.profilePic;    return data;  }  static late Account current;}